INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, 40, "エルフ", "ヴァイスフリューゲル　ランドソル支部", 10, 0, 14, "大空直美", 100801, "ユキ", "鏡で自分を見ること", "ボクは誰よりも美しい", "AB", 15, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪");
