INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (155, 42, "獣人族", "自警団（カォン）", 9, 0, 16, "内田真礼", 101001, "マホ", "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", "O", 10, 22, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？");
