INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (156, 46, "エルフ", "フォレスティエ", 12, 0, 17, "大橋彩香", 101201, "ハツネ", "妹と遊ぶこと、二度寝、昼寝、早寝", "みんなのために超能力を使う眠り姫", "A", 6, 24, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！");
