INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117, 21, "獣人族", "リトルリリカル", 4, 0, 10, "日高里菜", 102001, "ミミ", "かわいいもの集め", "お歌もにんじんも、ウサギさんも大好き♪", "O", 5, 3, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, 40, "ヒューマン", "サレンディア救護院", 6, 0, 12, "植田佳奈", 102101, "クルミ", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", "B", 9, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
