INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (156, 43, "エルフ", "サレンディア救護院", 10, 0, 17, "堀江由衣", 102801, "サレン", "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", "A", 9, 4, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！");
