INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (120, 22, "魔族", "ルーセント学院", 1, 0, 11, "久野美咲", 108301, "ミサキ（ハロウィン）", "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", "A", 14, 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
