INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, 40, "ヒューマン", "サレンディア救護院", 6, 0, 12, "植田佳奈", 108501, "クルミ（クリスマス）", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", "B", 9, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
