INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (155, 44, "獣人族", "トゥインクルウィッシュ", 8, 0, 16, "東山奈央", 108701, "ヒヨリ（ニューイヤー）", "人助け、応援", "人助けが大好き！　前向き格闘娘", "A", 2, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
