INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (154, 43, "魔族", "トワイライトキャラバン", 7, 0, 16, "橋本ちなみ", 109001, "エリコ（バレンタイン）", "実験、裁縫、料理", "運命の相手に一途すぎる乙女", "B", 13, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
